import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

fetch("http://localhost:9000/timer")
  .then((res) => res.text())
  .then((res) => {
    console.log("res: " + JSON.stringify(res));
    console.log("time: " + JSON.stringify(res.timerValue));
  });

class App extends Component {
  constructor(props) {
    //TODO
    super(props);
    //var time = this.callAPI();
    this.state = { time: 0 };

    //console.log("in constructor");
  }

  callAPI() {
    console.log("in callAPI");

    fetch("http://localhost:9000/timer/").then((res) => {
      let obj = JSON.parse(res);
      console.log("time: " + obj.timerValue);
      console.log("res: " + JSON.stringify(obj));
      return obj.timerValue;
    });
  }
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <p className="App-intro">{this.state.time}</p>
          <p>Hello Boozer!</p>
        </header>
      </div>
    );
  }
}

export default App;
